import React, { Suspense } from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';

// Import all the feature components
import UpdateName from './components/UpdateName';
import SubmitForm from './components/SubmitForm';
import TestFormStatus from './components/TestFormStatus';
import Greeting from './components/Greeting';
import ThemeContext from './components/ThemeContext';
import SimpleHeading from './components/SimpleHeading';
import ServerComponent from './components/ServerComponent';
import ClientComponent from './components/ClientComponent';
import ServerAction from './components/ServerAction';
import RefComponent from './components/RefComponent';
import SimpleContext from './components/SimpleContext';
import DeferredSearch from './components/DeferredSearch';
import PageWithMetadata from './components/PageWithMetadata';
import AsyncFunc from './components/AsyncFunc';

// Define a theme context
const theme = { color: 'green' };

function App() {
  return (
    <Router>
      <div className="App">
        <nav>
          <ul>
            <li><Link to="/">Home</Link></li>
            <li><Link to="/update-name">Update Name</Link></li>
            <li><Link to="/submit-form">Submit Form</Link></li>
            <li><Link to="/test-form-status">Test Form Status</Link></li>
            <li><Link to="/greeting">Greeting</Link></li>
            <li><Link to="/theme-context">Theme Context</Link></li>
            <li><Link to="/server-component">Server Component</Link></li>
            <li><Link to="/client-component">Client Component</Link></li>
            <li><Link to="/server-action">Server Action</Link></li>
            <li><Link to="/ref-component">Ref as Prop</Link></li>
            <li><Link to="/simple-context">Simple Context</Link></li>
            <li><Link to="/deferred-search">Deferred Search</Link></li>
            <li><Link to="/metadata">Metadata</Link></li>
            <li><Link to="/async-func">Async Function</Link></li>
          </ul>
        </nav>
        <ThemeContext.Provider value={theme}>
          <Suspense fallback={<div>Loading...</div>}> {/* Show this while waiting for the promise */}
            <Routes>
              <Route path="/" element={<Home />} />
              <Route path="/update-name" element={<UpdateName />} />
              <Route path="/submit-form" element={<SubmitForm />} />
              <Route path="/test-form-status" element={<TestFormStatus />} />
              <Route path="/greeting" element={<Greeting />} />
              <Route path="/theme-context" element={<SimpleHeading />} />
              <Route path="/server-component" element={<ServerComponent />} />
              <Route path="/client-component" element={<ClientComponent />} />
              <Route path="/server-action" element={<ServerAction />} />
              <Route path="/ref-component" element={<RefComponent />} />
              <Route path="/simple-context" element={<SimpleContext />} />
              <Route path="/deferred-search" element={<DeferredSearch />} />
              <Route path="/metadata" element={<PageWithMetadata />} />
              <Route path="/async-func" element={<AsyncFunc />} />
            </Routes>
          </Suspense>
        </ThemeContext.Provider>
      </div>
    </Router>
  );
}

// Home component with an overview of features
function Home() {
  return (
    <div>
      <h1>Welcome to the React 19 Features Showcase</h1>
      <p>Select a feature from the navigation to see it in action.</p>
    </div>
  );
}

export default App;
